import * as React from 'react';
// import {NavigationContainer} from '@react-navigation/native';
import {CardStyleInterpolators, createStackNavigator, HeaderStyleInterpolators, TransitionSpecs} from '@react-navigation/stack';
import MainScreen from "../app/main/MainScreen";
import LoginScreen from "../app/authentication/login/LoginScreen";
import ResetPasswordScreen from "../app/authentication/login/ResetPasswordScreen";
import RegistrationContainer from "./RegistrationContainer";
import AlertConfig from "../utils/alert/AlertConfig";
import {ConnectedComponent} from "react-redux";
import {View} from "react-native";
import SelectBox from "../components/SelectBox";
import {TransitionSpec} from "@react-navigation/stack/lib/typescript/src/types";

const Stack = createStackNavigator();

const MainContainer: React.FC = (props) => {

    const alert = new AlertConfig()

    return (
        <Stack.Navigator headerMode="none"
                         mode="card"
                         screenOptions={{
                             cardStyleInterpolator: CardStyleInterpolators.forHorizontalIOS
                         }}
                         initialRouteName="main">
            <Stack.Screen name="main">
                {props => <MainScreen navigation={props.navigation} alert={alert}/>}
            </Stack.Screen>
            <Stack.Screen name="login">
                {props => <LoginScreen navigation={props.navigation} alert={alert}/>}
            </Stack.Screen>
            <Stack.Screen name="resetPassword">
                {props => <ResetPasswordScreen navigation={props.navigation} alert={alert}/>}
            </Stack.Screen>
            <Stack.Screen name="registration">
                {props => <RegistrationContainer navigation={props.navigation} alert={alert}/>}
            </Stack.Screen>
        </Stack.Navigator>
    );
}
export default MainContainer
